pub enum ContractError {
    Std(StdError),
    Unauthorized {
    },
    CannotSetOwnAccount {
    },
    NotAllowed {
    },
    NoAllowance {
    },
    MessageTypeRejected {
    },
    DelegatePerm {
    },
    ReDelegatePerm {
    },
    UnDelegatePerm {
    },
    WithdrawPerm {
    },
    WithdrawAddrPerm {
    },
    UnsupportedMessage {
    },
    SettingExpiredAllowance(Expiration),
}

pub enum ExecuteMsg<T = Empty> where T: Clone + fmt::Debug + PartialEq +
         JsonSchema {
    Execute {
        msgs: Vec<CosmosMsg<T>>,
    },
    Freeze {
    },
    UpdateAdmins {
        admins: Vec<String>,
    },
    IncreaseAllowance {
        spender: String,
        amount: Coin,
        expires: Option<Expiration>,
    },
    DecreaseAllowance {
        spender: String,
        amount: Coin,
        expires: Option<Expiration>,
    },
    SetPermissions {
        spender: String,
        permissions: Permissions,
    },
}

pub enum QueryMsg<T = Empty> where T: Clone + fmt::Debug + PartialEq +
         JsonSchema {
    AdminList {
    },
    Allowance {
        spender: String,
    },
    Permissions {
        spender: String,
    },
    CanExecute {
        sender: String,
        msg: CosmosMsg<T>,
    },
    AllAllowances {
        start_after: Option<String>,
        limit: Option<u32>,
    },
    AllPermissions {
        start_after: Option<String>,
        limit: Option<u32>,
    },
}
